import React, { Component, Router, Switch, Route, } from "react";
import { Chart, Tooltip, Axis, Legend, Bar, Line} from "viser-react";

import BankPersonal from "./Reactjs";

class Parent extends Component {
    state = {
        name: "sivaprakash",
        age: 25
    };

    changeName = newName => this.setState({ name: newName });

    render() {
        return (
            <Router>
                <Switch>
                    <Route path="/BankPersonal"
                           render={() =>
                               <App name={this.state.name}
                                    age={this.state.age}
                                    changeName={this.changeName} />
                           } />

                </Switch>
            </Router>
        )
    }
}
export default Parent;
